        if(data == undefined){

        }else {
            return (
                <ul>
                    {data.map((item,index) =>
                        <li key={index}>
                            {
                                <a draggable="true" href="" id="one">{item}</a>
                            }
                        </li>
                    )}
                </ul>
            );
        }
    };


render() {
    return (
      <div class="holder">
          <h1>Save the Earth!</h1>
          <div className="game-div">
          <div id="bin">
              <img alt="" src="data:image/png;base64," />
          </div>
          <ul>
              {this.renderList(this.state.data)}
          </ul>
          <div id="bin2">
              <img alt="" src="data:image/png;base64," />
          </div>
          </div>
      </div>
    );
  }
}

export default GameComponent;
